import React from "react";
import { Card } from "../card/card-component";
import "./card-style.css";

export const CardList = (props) => {
  return (
    <div className="card-list">
      {console.log(props)}
      {props.kedi.map((cat) => (
        <Card key={cat.id} kedi={cat.name} />
      ))}
    </div>
  );
};
